import './App.css';
import Expertise_page from './Expertise_page';
import Header from './Header';
import Info_page from './Info_page';
import Intro from './Intro';
import Success_stories from './Success_stories';

function App() {
  return (
    <div>
      <Header/>
      <Intro/>
      <Expertise_page/>
      <Info_page/>
      <Success_stories/>
    </div>

  );
}

export default App;
